import React, { useState } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const TreeContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  position: relative;
  height: 600px;
  width: 800px;
  margin: auto;
`;

const Branch = styled(motion.div)`
  position: absolute;
  background-color: ${({ color }) => color || '#ddd'};
  border-radius: 50%;
  padding: 1em;
  width: 150px;
  height: 150px;
  display: flex;
  justify-content: center;
  align-items: center;
  text-align: center;
  color: white;
  font-weight: bold;
  cursor: pointer;
  z-index: 1;
`;

const SubSkill = styled(motion.div)`
  position: absolute;
  background-color: #f9f9f9;
  padding: 0.5em;
  border: 1px solid #ddd;
  border-radius: 5px;
  z-index: 2;
  transition: opacity 0.3s ease-in-out;
  opacity: ${({ visible }) => (visible ? 1 : 0)};
`;

// Positions for sub-skills relative to the hovered skill
const subSkillPositions = {
  Cognitive: [{ top: '-70px', left: '-90px' }, { top: '70px', left: '-50px' }, { top: '0px', left: '-120px' }],
  Leadership: [{ top: '-70px', left: '50px' }, { top: '70px', left: '50px' }, { top: '0px', left: '120px' }],
  Collaboration: [{ top: '-70px', left: '50px' }, { top: '70px', left: '50px' }, { top: '0px', left: '120px' }],
  Creativity: [{ top: '-70px', left: '-50px' }, { top: '70px', left: '-50px' }, { top: '0px', left: '-120px' }],
  Emotional: [{ top: '-70px', left: '-50px' }, { top: '70px', left: '-50px' }, { top: '0px', left: '-120px' }],
  'Social & Civic Engagement': [{ top: '-70px', left: '50px' }, { top: '70px', left: '50px' }, { top: '0px', left: '120px' }],
};

const branches = [
  { text: 'Cognitive', top: '10%', left: '10%', color: '#4CAF50' },
  { text: 'Leadership', top: '10%', left: '70%', color: '#E91E63' },
  { text: 'Collaboration', top: '50%', left: '80%', color: '#00BCD4' },
  { text: 'Creativity', top: '50%', left: '10%', color: '#FFC107' },
  { text: 'Emotional', top: '75%', left: '30%', color: '#FF9800' },
  { text: 'Social & Civic Engagement', top: '75%', left: '60%', color: '#3F51B5' },
];

const subSkills = {
  Cognitive: ['Problem Solving', 'Critical Thinking', 'System Thinking'],
  Leadership: ['Entrepreneurship', 'Organizing', 'Influence'],
  Collaboration: ['Negotiation', 'Conflict Mgmt.', 'Communication'],
  Creativity: ['Curiosity', 'Innovation', 'Visualization'],
  Emotional: ['Empathy', 'Resilience', 'Self-awareness'],
  'Social & Civic Engagement': ['Citizenship', 'Sustainability', 'Equality'],
};

const TreeBranch = ({ text, color, top, left, onHover, onLeave }) => {
  return (
    <Branch
      style={{ top, left }}
      color={color}
      onMouseEnter={() => onHover(text)}
      onMouseLeave={onLeave}
      whileHover={{ scale: 1.1 }}
      transition={{ duration: 0.3 }}
    >
      {text}
    </Branch>
  );
};

export const SkillsTree = () => {
  const [hoveredSkill, setHoveredSkill] = useState(null);

  const handleHover = (skill) => {
    setHoveredSkill(skill);
  };

  const handleLeave = () => {
    setHoveredSkill(null);
  };

  return (
    <TreeContainer>
      <h2>Tree of Skills</h2>
      {branches.map((branch, index) => (
        <TreeBranch
          key={index}
          text={branch.text}
          color={branch.color}
          top={branch.top}
          left={branch.left}
          onHover={handleHover}
          onLeave={handleLeave}
        />
      ))}

      {/* Render sub-skills near the hovered skill */}
      {hoveredSkill &&
        subSkills[hoveredSkill].map((subSkill, index) => (
          <SubSkill
            key={index}
            style={{
              top: `calc(${branches.find(b => b.text === hoveredSkill).top} + ${subSkillPositions[hoveredSkill][index].top})`,
              left: `calc(${branches.find(b => b.text === hoveredSkill).left} + ${subSkillPositions[hoveredSkill][index].left})`,
            }}
            visible={hoveredSkill !== null}
            animate={{ opacity: hoveredSkill ? 1 : 0 }}
            transition={{ duration: 0.3 }}
          >
            {subSkill}
          </SubSkill>
        ))}
    </TreeContainer>
  );
};
